import React, { useEffect, useRef, useState } from "react";

import DateCalculator from "./DateCalculator";

const Single_ReviewData = ({target}) => {

    console.log(target)
    const containerRef = useRef(null)
    const [FontSize, updateFONTSIZE] = useState({})
    const [WIDTH, updateWIDTH] = useState({fliped: false})

    useEffect(()=>{

        const divElement = containerRef.current
        const resizeObserver = new ResizeObserver(()=>{
            if(divElement){
                console.log(divElement.offsetWidth)
                updateFONTSIZE({
                    title : `${divElement.offsetWidth*0.09}px`,
                    content : `${divElement.offsetWidth*0.065}px`
                })
                updateWIDTH({
                    textbox : `${divElement.offsetWidth*0.18}vw`,
                    fliped : true
                })
            }
        })
    
        if(divElement){
            resizeObserver.observe(divElement)
        }

        return()=>{
            resizeObserver.disconnect()
        }

    },[containerRef])

    const Star_Reputation = (props) => {
        return <div
            style={{
                marginTop: '2vh',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                width: '100%'
            }}
        >
            <select 
                name="star_rating"
                required
                value={star_rating}
                onChange={(e)=>{
                    setStar_Rating(e.target.value)
                }}
                style={{
                    width: '90%',
                    padding: '1vh 2vw',
                    borderRadius: '8px',
                    border: 'black solid 2px',
                    borderBottom: 'black solid 4px',
                    backgroundColor: '#ff9933',
                    fontFamily: '큐트신민상'
                }}
            >
                <option value=""
                    style={{
                        textAlign: 'center'
                    }}
                >Select Reputation</option>
                <option value="5">⭐⭐⭐⭐⭐ (5점)</option>
                <option value="4">⭐⭐⭐⭐ (4점)</option>
                <option value="3">⭐⭐⭐ (3점)</option>
                <option value="2">⭐⭐ (2점)</option>
                <option value="1">⭐ (1점)</option>
            </select>
        </div>
    }
    return <React.Fragment>

        <div
        style={{
            width:'100%',
            height: '80%',
            marginLeft: '30px',
            display:'grid',
            gridAutoFlow: 'row',
            rowGap: '10px',
            alignItems: 'center',
            justifyItems: 'center',
            padding: '50px 10px',
            fontFamily: '큐트신민상',

            border: 'black solid 2.5px',
            borderRadius: '30px'
        }}
        ref={containerRef}
        >
            <div
            style={{
                justifySelf:'center',
                fontSize: FontSize.title
            }}
            >
            {target.placename}
            </div>

            <textarea
            style={{
                width: WIDTH.textbox,
                height: '30vh',
                letterSpacing: '3.5px',
                wordSpacing: '1px',
                lineHeight: '3.5vh',
                whiteSpace: 'pre-wrap',
                overflowWrap: 'break-word',
                justifySelf: 'center',
                fontSize: FontSize.content,
                backgroundColor: 'white',
                padding: '10px',
                borderRadius: '20px'
            }}
            >
            {target.user_post_text}
            </textarea>

            <div
            style={{
                justifySelf:'center',
                fontSize: FontSize.title
            }}
            >
            작성자: {target.user.name}
            </div>
            

            <div>Created</div>

            <DateCalculator
            date={target.created_at}
            />
            

            <div
            style={{
                width: '90%',
                display: 'grid',
                gridTemplateColumns: '1fr 1fr 1fr',
                rowGap: '1vw',
                border: 'white solid 3px',
                justifyItems: 'center',
                padding: '10px 5px'
            }}
            >
                {target.picture_url_array.map((url)=>{
                    return <img
                    src={url}
                    style={{
                        width: '10vw',
                        aspectRatio: '1/1',
                        objectFit: 'cover',
                        border:'white solid 3px',
                        borderRadius: '10px',
                    }}
                    >
                    </img>
                })}

            </div>

            <Star_Reputation/>                

            

        </div>

    </React.Fragment>



}

export default Single_ReviewData
